    const [textEmail, setTextEmail] = React.useState('');
    const [textPassword, setTextPassword] = React.useState('');

    return (
        <>
            <TextInput
                label="Email"
                value={textEmail}
                onChangeText={textEmail => setTextEmail(text)}
            />

            <TextInput
                label="Password"
                value={textPassword}
                onChangeText={textPassword => setTextPassword(text)}
            />
        </>
    )
}
